class Datamodel {  String? message;  Data? data;  int? status;  bool? isSuccess;  Datamodel({this.message, this.data, this.status, this.isSuccess});  Datamodel.fromJson(Map<String, dynamic> json) {    message = json['Message'];    data = json['Data'] != null ? new Data.fromJson(json['Data']) : null;    status = json['Status'];    isSuccess = json['IsSuccess'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['Message'] = this.message;    if (this.data != null) {      data['Data'] = this.data!.toJson();    }    data['Status'] = this.status;    data['IsSuccess'] = this.isSuccess;    return data;  }}class Data {  String? username;  String? emailId;  String? password;  String? sId;  int? iV;  Data({this.username, this.emailId, this.password, this.sId, this.iV});  Data.fromJson(Map<String, dynamic> json) {    username = json['username'];    emailId = json['emailId'];    password = json['password'];    sId = json['_id'];    iV = json['__v'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['username'] = this.username;    data['emailId'] = this.emailId;    data['password'] = this.password;    data['_id'] = this.sId;    data['__v'] = this.iV;    return data;  }}